import React, { useEffect, useState } from 'react';
import { ErrorMessage, Field, Form, Formik } from 'formik';
import { useLocation } from 'react-router-dom'
import { Link } from "react-router-dom";
import DataTable from 'react-data-table-component';
import GenericApi from '../Api/Services/GenericApi';
import DocumentoSiriusApi from '../Api/Services/DocumentoSiriusApi';
import '../Utils/Constants';
import Spinner from '../Utils/Spinner';
import { quitarAcentos } from '../Utils/Common';

import ModalGen from '../Utils/Modals/ModalGeneric';

function LogProcesoDisciplinario() {

    const [errorApi, setErrorApi] = useState('');
    const [getSeach, setSeach] = useState('');
    const location = useLocation()
    const { from } = location.state
    let radicado = from.radicado;
    let procesoDisciplinarioId = from.procesoDisciplinarioId;
    let vigencia = from.vigencia;

    const [getRespuestaLog, setRespuestaLog] = useState(false);
    const [getLogLista, setLogLista] = useState({ data: [], links: [], meta: [] });
    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });


    useEffect(() => {
        async function fetchData() {
            cargarLogProcesoDisciplinario()
        }
        fetchData();
    }, []);


    const cargarLogProcesoDisciplinario = () => {

        GenericApi.getGeneric('log-proceso-disciplinario/get-log-etapa/'+procesoDisciplinarioId).then(
            datos =>{
                if (!datos.error) {
                    setLogLista(datos);
                    setRespuestaLog(true);

                    console.log(datos);
                }else{
                    window.showSpinner(false);
                    setModalState({ title: "LOG PROCESO DISCIPLINARIO ", message: "OCURRIO UN ERROR AL CARGAR LA INFORMACIÓN DEL LOG.", show: true, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
            } 
        )

    }


    const DetalleLog = () => {

        if (getLogLista.data != null && typeof (getLogLista.data) != 'undefined') {
            return (

                getLogLista.data.map((log, i) => {
                    return (
                        <li class="timeline-item mb-5 text-uppercase">
                            <span className="timeline-icon">
                                <i class="fas fa-cog"></i>
                            </span>

                            <div>
                                <div className="block-header block-header-log block-header-default">
                                <p className="block-title">{log.attributes.nombre_etapa} - {log.attributes.nombre_fase}</p>
                                    <div className="block-options">
                                        <div className="timeline-event-time block-options-item font-size-sm font-w600 text-white">
                                            {log.attributes.fecha_registro}
                                        </div>
                                    </div>
                                </div>

                                <div className="block-content">
                                        <div className="media font-size-sm push">               
                                  
                                            <div className="media-body">
                                                <small>                                                   
                                                    <span className='txt-green'><strong>{log.attributes.nombre_actividad}</strong></span><br/>
                                                    <span><strong>Registro realizado por: </strong>{log.attributes.nombre_funcionario_registra} de {log.attributes.nombre_dependencia_origen}</span><br/>                                         
                                                    {log.attributes.tipo_evaluacion!=null?<><strong>Tipo de evaluación: </strong><span>{log.attributes.tipo_evaluacion}</span><br/></>:""}
                                                    {log.attributes.observacion_corta!=null?<><span data-toggle="modal" data-target={"#q"+log.id}><strong>OBSERVACIÓN: </strong> {log.attributes.observacion_corta}</span><br/></>:""}
                                                    {log.attributes.transferencia!=null?<span className='txt-red'>{log.attributes.transferencia}</span>:""}
                                                </small>
                                            </div>
                                        </div>
                                    </div>
                                </div>

                                <div>                                    
                                    <div className="modal fade" id={"q"+log.id} tabindex="-1" role="dialog" aria-labelledby="descriptionModalLabel" aria-hidden="true">
                                        <div className="modal-dialog modal-xl" role="document">
                                            <div className="modal-content">
                                            <div className="modal-header block.block-themed">
                                                <h5 className="modal-title" id="descriptionModalLabel">{radicado} - {vigencia}:: EVALUACIÓN DEL RADICADO</h5>
                                                <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                                                <span aria-hidden="true">&times;</span>
                                                </button>
                                            </div>
                                            <div className="modal-body">
                                                {log.attributes.observacion_corta}
                                            </div>                  
                                            </div>
                                        </div>
                                    </div>
                                </div>

                            </li>
                    )
                })
            )
        }
    }


    return (
        <>
            <Formik>

                <>

                <div className="w2d_block">
                    <nav aria-label="breadcrumb">
                        <ol className="breadcrumb breadcrumb-alt push">
                            <li className="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/MisPendientes`}><small>Mis Pendientes</small></Link></li>
                            <li className="breadcrumb-item"> <small>Log Proceso Disciplinario</small></li>
                        </ol>
                    </nav>
                </div>

                    <section class="py-5">
                        <ul class="timeline-with-icons">
                            {DetalleLog()} 

                        </ul>
                    </section>
                </>
            </Formik>
        </>
    );
}

export default LogProcesoDisciplinario;
